	add("winne", "{\"term\":\"winne\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"scots\"], \"text\":\"From Middle english (1100-1500) from Old english (ca. 450-1100) {{m|ang|wynn||joy, delight, pleasure}}, from Proto-germanic {{m|gem-pro|*wunjō||joy, desire}}, from Proto-indo-european {{m|ine-pro|*wenh₁-||to wish, desire, love}}. Cognate with Scots {{m|sco|win}}, {{m|sco|wind||pleasure, joy}}, German {{m|de|Wonne||bliss, joy, delight}}, Danish {{m|da|ynde||grace}}. See also {{l|en|winly}}, {{l|en|winsome}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Joy; delight; pleasure\", \"priority\":1}]}, \"synonyms\":{}}");

	add("winnipeg", "{\"term\":\"winnipeg\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Ojibwe\"], \"text\":\"* From Ojibwe \u0027wiinibig\u0027 (\u0026quot;dirty waters\u0026quot;), from wiini\u0027|wiini’ (\u0026quot;to make someone dirty\u0026quot;), wiinad (\u0026quot;it is dirty\u0026quot;), plus nibi (\u0026quot;water\u0026quot;), plural nibi|nibig (\u0026quot;waters\u0026quot;).* After the lake, from Cree and Ojibwe \u0027ouenpig\u0027 (\u0026quot;murky water\u0026quot;), describing the river\u0027s water entering the lake (CanOD).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A city in Canada, the provincial capital of Manitoba\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Lake Winnipeg, a large lake in Manitoba\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Winnipeg River, a river that flows 813 km from Lake of the Woods, Ontario, into Lake Winnipeg\", \"priority\":3}]}, \"synonyms\":{}}");

	add("winnipegger", "{\"term\":\"winnipegger\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Winnipeg|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A native or resident of Winnipeg, Manitoba, Canada\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1880\u0027\u0027, “The Red River of the North” in \u0027Harper\u0027s\u0027, v 60, n 360 (May), p 814\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When a \u0027\u0027Winnipegger\u0027\u0027 gets his wagon stuck in one of them, he loosens the the traces and lets the horses scramble out; and then, pulling off his clothes, goes in to extricate the vehicle, which, by the skillful use of ropes, he usually accomplishes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1884\u0027\u0027, \u0027The Mail\u0027, Toronto, 24 Oct 1884\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Our tears were shed on behalf of the \u0027\u0027Winnipegger\u0027\u0027 who has himself photographed in the shaggy buffalo coat\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1948\u0027\u0027, H. L. Mencken, \u0026quot;What the People of American Towns Call Themselves,\u0026quot; \u0027American Speech\u0027, vol 23 no 3/4 (Oct-Dec\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A citizen of Albert Lea, Minn., calls himself an \u0027Albert Lean\u0027; . . . one of Winnipeg, Man., is a \u0027\u0027\u0027Winnipegger\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Paul Friesen, \u0026quot;[http://winnipegsun.com/Sports/Columnists/Friesen_Paul/2007/05/11/4172032-sun.html Wheat King crowned]\u0026quot;, \u0027Winnipeg Sun\u0027, Fri 11 May 2007\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The 19-year-old \u0027\u0027Winnipegger\u0027\u0027 just signed his first pro hockey contract, a three-year deal with the Colorado Avalanche\", \"priority\":9}]}, \"synonyms\":{}}");

	add("wintard", "{\"term\":\"wintard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Windows|tard|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A user or advocate of w:Microsoft Microsoft Windows\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 March 23, Kevin M. “ktaggart” Taggart, ‘Re: \u0026quot;Infinite Loop\u0026quot;’, \u0026lt;tt\u0026gt;comp.sys.mac.advocacy\u0026lt;/tt\u0026gt;, \u0027Usenet\u0027 [http://groups.google.com/group/comp.sys.mac.advocacy/msg/c036c35907ca1380\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Stop being such a \u0027\u0027Wintard\u0027\u0027 and at least have the backbone required to acknowledge some brilliant engineering\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 June 25, “7” (author), “Re: [News] Windows 98 Users Headed for Linux?”, \u0026lt;tt\u0026gt;comp.os.linux.advocacy\u0026lt;/tt\u0026gt;, \u0027Usenet\u0027 [http://schestowitz.com/UseNet/2006/June_2006_3/msg00478.html\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"How come you post all your \u0027\u0027wintard\u0027\u0027 drivel in comp.os.linux.advocacy instead of windope.clippy.os.worshipper.advocacy where you can be more readily appreciated. LOL\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027 August 29, \u0026quot;nostop\u0026quot; (author), \u0026quot;Re: Why Vists is sometimes no more useful than a pile of wet dog crap\u0026quot;, \u0026lt;tt\u0026gt;microsoft.public.windows.vista.general\u0026lt;/tt\u0026gt;, \u0027Usenet\u0027 [http://groups.google.com/group/microsoft.public.windows.vista.general/browse_thread/thread/c1b1b8de81f82842/4ddad7605841ebe0\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Wonder if the other \u0027\u0027Wintards\u0027\u0027 around here get as large an allowance from their mommies as you obviously do\", \"priority\":7}]}, \"synonyms\":{}}");

